import axios from 'axios'
const baseUrl = 'http://localhost:3000/api/download'

const download = async (url) => {
  console.log("suoriteaan download")
  const parameters = 
    {
      "osoite": url
    } 
    axios.post(baseUrl, parameters)
      .then()
}

export default {download}
